sys_variable_value.value:
(function execute(inputs, outputs) {

var cmd = './hcli token mint'

if (inputs.token_id) { cmd = cmd + ' --tokenid ' + inputs.token_id }
if (inputs.amount) { cmd = cmd +  ' --amount ' + inputs.amount }

for (i = 0; i < inputs.metadata.length; i++) { cmd = cmd + " --metadata '" + inputs.metadata[i] +"'" }

for (i = 0; i < inputs.sign_with.length; i++) { cmd = cmd + ' --sign ' + inputs.sign_with[i] }


outputs.cmd = cmd

})(inputs, outputs);

